package cf.tinkerit.rosetta.generator.impl;


import cf.tinkerit.rosetta.generator.AbstractSubGenerator;

import javax.imageio.ImageIO;
import java.io.ByteArrayInputStream;
import java.io.File;
import java.io.IOException;
import java.util.Base64;

public class LogoGenerator extends AbstractSubGenerator {
    private static final String imageString = "";


    @Override
    public String getModuleName() {
        return "images";
    }

    @Override
    public void generate() {
        // create the base directory is it is absent
        String baseDir = getTargetDirectory();
        File file = new File(baseDir);
        if (!file.exists()) {
            file.mkdirs();
        }
        try {
            byte[] imageByte;
            File outFile = new File(baseDir, "logo.png");
            Base64.Decoder decoder = Base64.getDecoder();
            imageByte = decoder.decode(imageString);
            ByteArrayInputStream bis = new ByteArrayInputStream(imageByte);
            ImageIO.write(ImageIO.read(bis), "png", outFile);
            bis.close();
        }
        catch (IOException e) {
            throw new RuntimeException(
                String.format("I/O error while generating logo.png"),
                e
            );
        }
    }

}
